import React from 'react';
import BookingItem from './BookingItem'

function BookingsList({bookingsData}){


    return(
        <div>
            {bookingsData.map((booking) => {
                return (<BookingItem bookingName ={booking.guest_nam}/>)
            })}
        </div>    
    )

};


export default BookingsList;
